import { AGREGAR_PERSONAJE, ELIMINAR_PERSONAJE } from "./actionsType"

const agregarPersonaje = (character) => {
    return {
        type: 'AGREGAR_PERSONAJE',
        payload: character
    }  
}

export const eliminarPersonaje = (id) => {
    return {
        type: 'ELIMINAR_PERSONAJE',
        payload: id
    }  
}

export default {agregarPersonaje, eliminarPersonaje};
